import React, { useState } from 'react';
import { useBookings } from '../context/BookingContext';
import { useAuth } from '../context/AuthContext';
import { format, addDays, startOfWeek, isSameDay, parseISO } from 'date-fns';
import './ScheduleView.css';

const HOURS = Array.from({ length: 11 }, (_, i) => i + 9); // 9 to 19
const DAYS = 7; // Monday to Sunday

const WeekScheduleView: React.FC = () => {
  const { bookings, removeBooking, editBooking } = useBookings();
  const { isAuthenticated } = useAuth();
  const [selectedDate, setSelectedDate] = useState(new Date().toISOString().split('T')[0]);
  const selected = new Date(selectedDate);
  const weekStart = startOfWeek(selected, { weekStartsOn: 1 }); // Monday
  const weekDates = Array.from({ length: DAYS }, (_, i) => addDays(weekStart, i));
  const [editingBooking, setEditingBooking] = useState<any>(null);
  const [editForm, setEditForm] = useState<any>(null);

  // Helper to get bookings for a specific date and hour slot
  const getBookingsForCell = (date: Date, hour: number) => {
    return bookings.filter(booking => {
      const bookingDate = booking.date.length > 10 ? booking.date.split('T')[0] : booking.date;
      if (!isSameDay(parseISO(bookingDate), date)) return false;
      const [startHour, startMin] = booking.startTime.split(':').map(Number);
      const [endHour, endMin] = booking.endTime.split(':').map(Number);
      const slotStart = hour * 60;
      const slotEnd = (hour + 1) * 60;
      const bookingStart = startHour * 60 + startMin;
      const bookingEnd = endHour * 60 + endMin;
      // Overlap if booking starts before slot ends and ends after slot starts
      return bookingStart < slotEnd && bookingEnd > slotStart;
    });
  };

  const getBookingTypeColor = (type: string) => {
    switch (type) {
      case 'meeting':
        return '#e74c3c'; // red
      case 'teaching_session':
        return '#27ae60'; // green
      case 'stand_up':
        return '#2980ef'; // blue
      default:
        return '#e74c3c';
    }
  };

  const getBookingStyle = (booking: any, hour: number) => {
    const [startHour, startMin] = booking.startTime.split(':').map(Number);
    const [endHour, endMin] = booking.endTime.split(':').map(Number);
    const slotStart = hour * 60;
    const slotEnd = (hour + 1) * 60;
    const bookingStart = startHour * 60 + startMin;
    const bookingEnd = endHour * 60 + endMin;
    // Calculate overlap in minutes
    const overlapStart = Math.max(slotStart, bookingStart);
    const overlapEnd = Math.min(slotEnd, bookingEnd);
    const overlapMinutes = Math.max(0, overlapEnd - overlapStart);
    const percent = (overlapMinutes / 60) * 100;
    const offset = ((overlapStart - slotStart) / 60) * 100;
    return {
      height: `${percent}%`,
      top: `${offset}%`,
      position: 'absolute' as 'absolute',
      left: '2px',
      right: '2px',
    };
  };

  const handleEditClick = (booking: any) => {
    setEditingBooking(booking);
    setEditForm({ ...booking });
  };

  const handleEditChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setEditForm((prev: any) => ({ ...prev, [name]: value }));
  };

  const handleEditSave = () => {
    if (editingBooking) {
      editBooking(editingBooking.id, editForm);
      setEditingBooking(null);
    }
  };

  const handleEditCancel = () => {
    setEditingBooking(null);
  };

  return (
    <div className="week-schedule-container">
      <div className="week-schedule-header">
        <label htmlFor="week-date-picker">Select Week: </label>
        <input
          id="week-date-picker"
          type="date"
          value={selectedDate}
          onChange={e => setSelectedDate(e.target.value)}
        />
      </div>
      <table className="week-schedule-table">
        <thead>
          <tr>
            <th className="time-col"></th>
            {weekDates.map(date => (
              <th key={date.toISOString()} className="date-col">
                <div>{format(date, 'EEE')}</div>
                <div>{format(date, 'dd/MM')}</div>
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {HOURS.map(hour => (
            <tr key={hour}>
              <td className="time-col">{format(new Date().setHours(hour, 0, 0, 0), 'h a')}</td>
              {weekDates.map(date => (
                <td key={date.toISOString()} className="cell" style={{ position: 'relative', height: 60 }}>
                  {getBookingsForCell(date, hour).map(booking => (
                    <div
                      key={booking.id}
                      className="booking-item"
                      style={{
                        backgroundColor: getBookingTypeColor(booking.type),
                        ...getBookingStyle(booking, hour)
                      }}
                      title={`${booking.title} - ${booking.booker} (${booking.startTime} - ${booking.endTime})`}
                    >
                      <div className="booking-content">
                        <div className="booking-title">{booking.title}</div>
                        <div className="booking-details">
                          <span>{booking.booker}</span>
                          <span>{booking.startTime} - {booking.endTime}</span>
                        </div>
                        <div className="booking-type">
                          {booking.type.replace('_', ' ').toUpperCase()}
                        </div>
                        {isAuthenticated && (
                          <div style={{ display: 'flex', gap: 8, marginTop: 4 }}>
                            <button style={{ background: 'none', border: 'none', color: 'white', cursor: 'pointer' }} onClick={() => handleEditClick(booking)} title="Edit">✏️</button>
                            <button style={{ background: 'none', border: 'none', color: 'white', cursor: 'pointer' }} onClick={() => removeBooking(booking.id)} title="Delete">🗑️</button>
                          </div>
                        )}
                      </div>
                    </div>
                  ))}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
      {editingBooking && (
        <div className="modal-overlay">
          <div className="modal-content">
            <h3>Edit Booking</h3>
            <input name="title" value={editForm.title} onChange={handleEditChange} placeholder="Title" />
            <input name="booker" value={editForm.booker} onChange={handleEditChange} placeholder="Booker" />
            <input name="presenter" value={editForm.presenter} onChange={handleEditChange} placeholder="Presenter" />
            <input name="startTime" value={editForm.startTime} onChange={handleEditChange} type="time" />
            <input name="endTime" value={editForm.endTime} onChange={handleEditChange} type="time" />
            <select name="type" value={editForm.type} onChange={handleEditChange}>
              <option value="meeting">Meeting</option>
              <option value="teaching_session">Teaching Session</option>
              <option value="stand_up">Stand-up</option>
            </select>
            <input name="numberOfPeople" value={editForm.numberOfPeople} onChange={handleEditChange} type="number" min="1" max="50" />
            <textarea name="description" value={editForm.description} onChange={handleEditChange} placeholder="Description" />
            <div style={{ display: 'flex', gap: 8, marginTop: 12 }}>
              <button onClick={handleEditSave}>Save</button>
              <button onClick={handleEditCancel}>Cancel</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default WeekScheduleView;
